import React from 'react';




const AddUser = props =>  {
    const AddUserHandler = event =>{
        event.preventDefault();
    };


  return (
    <form onSubmit={AddUserHandler}>
        <label>Username</label>
        <input id="username" type="text"/>
        <label>Age</label>
        <input id="age" type="number"/>>
    </form>
  );
}

export default AddUser;
